(5, 1, 1, 'Macphone', '', 'macphone', 'Apple laptops', 'Apple laptops MacBook Air', 'Powerful and chic Apple laptops'),
(5, 1, 2, 'Laptops', 'O mais recente processador Intel, um disco rígido maior, muita memória, e até mesmo mais novos recursos todos cabem dentro de apenas uma polegada libertadora. Os novos Mac laptops possuem a performance, poder e conectividade de um computador desktop. Sem a parte da mesa.', 'laptops', ' Laptops da Apple', '', ' A Apple poderosa e chique'),
(5, 1, 3, 'Laptops', 'The latest Intel processor, a bigger hard drive, plenty of memory, and even more new features all fit inside just one liberating inch. The new Mac laptops have the performance, power, and connectivity of a desktop computer. Without the desk part.', 'laptops', 'Apple laptops', 'Apple MacBook Air-Laptops', 'Powerful and chic Apple laptops'),
(5, 1, 4, 'Portátiles', 'El último procesador Intel, un disco duro más grande, con profusión de memoria y otras novedades. Todo en sólo 2,59 cm libres de cualquier obstrucción. Las nuevas portátiles Mac cumplir rendimiento, potencia y conectividad de una computadora de escritorio. Sin la parte del escritorio.', 'portatiles-apple', 'Portátiles Apple', 'portátiles apple macbook air', 'portátiles apple poderoso y el diseño'),
