(4, 1, 'About us', 'Learn more about us', 'about us, informations', '<h2>About us</h2>\r\n<h3>Our company</h3>\r\n<p>Our company</p>\r\n<h3>Our team</h3>\r\n<p>Our team</p>\r\n<h3>Informations</h3>\r\n<p>Informations</p>', 'about-us'),
(4, 2, 'About us', 'Learn more about us', 'about us, informations', '<h2>About us</h2>\r\n<h3>Our company</h3>\r\n<p>Our company</p>\r\n<h3>Our team</h3>\r\n<p>Our team</p>\r\n<h3>Informations</h3>\r\n<p>Informations</p>', 'about-us'),
(4, 3, 'Über uns', 'Learn more about us', 'über uns, Informationen', '<h2>About us</h2>\r\n<h3>Our company</h3>\r\n<p>Our company</p>\r\n<h3>Our team</h3>\r\n<p>Our team</p>\r\n<h3>Informations</h3>\r\n<p>Informations</p>', 'uber-uns'),
(4, 4, 'Sobre', 'Conozca más sobre nosotros', 'sobre, información', '<h2>Sobre</h2>', 'sobre'),
(4, 5, 'A propos', 'Apprenez-en d''avantage sur nous', 'à propos, informations', '<p style="text-align: justify;">Dans un cadre à la décoration japonisante épurée et à l’accueil chaleureux, nous vous invitons à découvrir nos recettes classiques pour certaines et innovantes pour d’autres, de sushi, maki, california, maki spéciaux, spring roll, Yakitori… Nos Sushimen qualifiés préparent tous les plats à la commande pour vous assurer une fraîcheur irréprochable.</p>\r\n<p style="text-align: justify;"> </p>\r\n<p style="text-align: justify;">A part les sushi, nous élargissons notre carte à d’autres mets asiatiques à l’instar de la succulente soupe aux vermicelles chinois, le riz sauté aux crevettes, les rouleaux de printemps et nems… Bref, Ben’Sushi est le restaurant idéal pour les amateurs de la cuisine asiatique.</p>\r\n<p style="text-align: justify;"> </p>\r\n<p style="text-align: justify;">Hautement qualifiés, nos cuisiniers peuvent se prévaloir, d’avoir les connaissances les plus pointues dans le façonnage et la préparation de sushi, dans le respect total de la tradition, de l’hygiène et d’une mini-industrie qui se veut innovante et respectueuse de l’environnement et de la santé de tous.</p>\r\n<p style="text-align: justify;"> </p>\r\n<p style="text-align: justify;"> Dans le sens de répondre au mieux à vos attentes ainsi qu’aux exigences de la restauration telle que nous la concevons, nous n’avons lesigne sur aucun effort pour nous équiper d’appareils et de locaux spécifiques répondant rigoureusement aux normes qualitatives les plus exigeantes, et notre fierté a été bien grande en recevant des mains du ministre de l’environnement le prix du restaurant le plus propre de la ville de Tunis.</p>\r\n<p style="text-align: justify;"> <img src="http://www.ben-sushi.tn/img/cms/IMG_1147.JPG" alt="" width="650" height="488" /></p>\r\n<p style="text-align: justify;"><img src="http://www.ben-sushi.tn/img/cms/IMG_0414.JPG" alt="" width="650" height="491" /></p>\r\n<p style="text-align: justify;"><img src="http://www.ben-sushi.tn/img/cms/DSC_0107.jpg" alt="" width="650" height="432" /></p>\r\n<p style="text-align: justify;"> <img src="http://www.ben-sushi.tn/img/cms/PHOTO-RESTO1.jpg" alt="" width="650" height="488" /></p>\r\n<p style="text-align: justify;"><img src="http://www.ben-sushi.tn/img/cms/PHOTO-RESTO2.jpg" alt="" width="650" height="491" /></p>\r\n<p style="text-align: justify;"><img src="http://www.ben-sushi.tn/img/cms/PHOTO-RESTO3.jpg" alt="" width="650" height="432" /></p>\r\n<p style="text-align: justify;"><img src="http://www.ben-sushi.tn/img/cms/PHOTO-RESTO4.jpg" alt="" width="650" height="432" /></p>\r\n<div style="visibility: hidden;">Copyright Shortcut Solutions © 2014 - Developpeur Web : Mbarki Chadi Contact : chadi.mbarki@shortcut-solutions.tn</div>', 'a-propos'),
(4, 6, 'Chi siamo', 'Per sapere chi siamo', 'chi siamo, informazioni', '<h2>Chi siamo</h2>\r\n<h3>La nostra azienda</h3>\r\n<p>La nostra azienda</p>\r\n<h3>Il nostro team</h3>\r\n<p>Il nostro team</p>\r\n<h3>Informazioni</h3>\r\n<p>Informazioni</p>', 'chi-siamo'),
(5, 1, 'Secure payment', 'Our secure payment mean', 'secure payment, ssl, visa, mastercard, paypal', '<h2>Secure payment</h2>\r\n<h3>Our secure payment</h3><p>With SSL</p>\r\n<h3>Using Visa/Mastercard/Paypal</h3><p>About this services</p>', 'secure-payment'),
(5, 2, 'Secure payment', 'Our secure payment mean', 'secure payment, ssl, visa, mastercard, paypal', '<h2>Secure payment</h2>\r\n<h3>Our secure payment</h3><p>With SSL</p>\r\n<h3>Using Visa/Mastercard/Paypal</h3><p>About this services</p>', 'secure-payment'),
(5, 3, 'Sichere Zahlung', 'Unsere Sicherheits-Zahlungsmethoden', 'Sichere Zahlung, SSL, Visa, MasterCard, PayPal', '<h2>Secure payment</h2>\r\n<h3>Our secure payment</h3><p>With SSL</p>\r\n<h3>Using Visa/Mastercard/Paypal</h3><p>About this services</p>', 'sichere-zahlung'),
(5, 4, 'Pago seguro', 'Ofrecemos pago seguro', 'pago seguro, ssl, visa, mastercard, paypal', '<h2><span id="result_box"><span style="background-color: #ffffff;" title="Paiement sécurisé">Pago seguro</span></span></h2>\r\n<h3><span id="result_box"><span style="background-color: #ffffff;" title="Notre offre de paiement sécurisé">Ofrecemos pago seguro</span></span></h3>\r\n<p><span id="result_box"><span style="background-color: #ffffff;" title="Avec SSL">SSL</span></span></p>\r\n<h3><span id="result_box"><span style="background-color: #ffffff;" title="Utilisation de Visa/Mastercard/Paypal">Utilice Visa / Mastercard / Paypal</span></span></h3>\r\n<p><span id="result_box"><span style="background-color: #ffffff;" title="A propos de ces services">Acerca de estos servicios</span></span></p>', 'pago-seguro'),
(5, 5, 'Paiement sécurisé', 'Notre offre de paiement sécurisé', 'paiement sécurisé, ssl, visa, mastercard, paypal', '<h2>Paiement sécurisé</h2>\r\n<h3>Notre offre de paiement sécurisé</h3><p>Avec SSL</p>\r\n<h3>Utilisation de Visa/Mastercard/Paypal</h3><p>A propos de ces services</p>', 'paiement-securise'),
(5, 6, 'Pagamento sicuro', 'Il nostro mezzo di pagamento sicuro', 'pagamento sicuro, ssl, visa, mastercard, paypal', '<h2>Pagamento sicuro</h2>\r\n<h3>Il nostro pagamento sicuro</h3><p>Con SSL</p>\r\n<h3>Usando Visa/Mastercard/Paypal</h3><p>Cosa sono questi servizi</p>', 'pagamento-sicuro'),
