(6, 5, 'Maitre Traiteur', '', '', '<p style="text-align: justify;"><strong>Service business<br /></strong></p>\r\n<p style="text-align: justify;">Vous souhaitez organiser vos déjeuners d''affaire dans vos bureaux, sans avoir à vous déplacer ? Ben''Sushi se charge de toute l''organisation, vous proposant ainsi un déjeuner "clé en main". Cela va du choix du menu (qui peut être fait sur-mesure selon vos exigences) et peut aller jusqu''à la mise en place et service. Nous nous ferons un plaisir de vous épargner les contraintes du déplacement en restaurant.</p>\r\n<p style="text-align: justify;"> </p>\r\n<p style="text-align: justify;"><strong>Dîners et Apéros<br /></strong></p>\r\n<p style="text-align: justify;">Pour que vos apéros, dîners entre amis, ou même dîners en tête-à-tête soient une parfaite réussite sans que vous n’ayez à vous turlupiner en vous mettant aux fournaux, Ben''Sushi se charge d’établir le menu de votre convenance, de vous le préparer minutieusement, de joliment le présenter et de vous en assurer la livraison en véhicule réfrigéré (sur le grand Tunis).</p>\r\n<p style="text-align: justify;"> </p>\r\n<p style="text-align: justify;"><strong>Réceptions et Mariages<br /></strong></p>\r\n<p style="text-align: justify;">Pour que vos réceptions, cocktails, voire même mariages soient des plus originaux, choisissez d''agrémenter vos buffets et tables avec des sushi qui raviront vos convives tant par leurs couleurs que par leur saveur. Ben''Sushi se charge de la livraison en véhicule réfrigéré ainsi que de la mise en place.</p>\r\n<p> </p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/1.JPG" alt="" width="650" height="487" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/2.JPG" alt="" width="650" height="432" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/3.JPG" alt="" width="650" height="432" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/4.jpg" alt="" width="650" height="412" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/5.jpg" alt="" width="650" height="488" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/6.jpg" alt="" width="650" height="445" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/7.jpg" alt="" width="650" height="477" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/8.jpg" alt="" width="650" height="433" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/9.jpg" alt="" width="650" height="520" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/10.jpg" alt="" width="650" height="432" /></strong></p>\r\n<p><strong><img src="http://localhost/bensushi/img/cms/401762_296375933743518_469444971_n.jpg" alt="" width="650" height="431" /></strong></p>', 'maitre-traiteur'),
